import Dashboard from './Dashboard/Dashboard'
import React, { Component } from 'react';
import './App.css';

class App extends Component {
  state = {
    persons: [
      {id:'aaa', name: 'Max', age: 28 },
      {id:'bbb', name: 'William', age: 26 },
      {id:'ccc', name: 'Isabella', age: 23 }
    ],
    otherState: 'some other value',
    showPersons: false
  }

  render() {

    return (
      <div className="App">
       <Dashboard 
       id={"1"} 
       name={"btc"} 
       marketcap={"111"} 
       price={"$4567"} 
       change={"$34567"}
       vol={"4567889"}
       supply={"23446457"} />
      </div>
    );
  }
}

export default App;
